<script id="graphStyleTemplate" type="text/html">
    <style>
       .graphWrapper{
    border-color: {{=m.backgroundBorderColor}};
    border-radius: {{=m.backgroundBorderRadius}};
    border-width: {{=m.backgroundBorderWidth}};
    border-style: solid;
    {{ if(m.backgroundGradient == true){ }}
        background: -webkit-linear-gradient( {{=m.backgroundStartColor}} , {{=m.backgroundEndColor}} );
        background: -o-linear-gradient( {{=m.backgroundStartColor}} , {{=m.backgroundEndColor}} );
        background: -moz-linear-gradient( {{=m.backgroundStartColor}} , {{=m.backgroundEndColor}} );
        background: -linear-gradient( {{=m.backgroundStartColor}} , {{=m.backgroundEndColor}} );
        background-image: linear-gradient(to bottom, {{=m.backgroundStartColor}} 0%, {{=m.backgroundEndColor}} 100%);
    {{ }else{ }}
        background: {{=m.backgroundColor}};
    {{ } }}
}

       .graphWrapper{
  max-width: {{= (m.pluginWidth == '1000px') ? '100%' : m.pluginWidth }};
}
      h1{
        text-align: {{=m.titleAlign}};
      }
      .xAxisLabel, .yAxisLabel, .c3-axis-x-label, .c3-axis-y-label{
        font-size: {{=m.axesFontSize}};
        fill: {{=m.axesFontColor}};
        font-family: {{=m.axesFontFamily}};
      }
      .graph{
        height: {{=parseInt(m.pluginHeight) - parseInt(m.axesFontSize)}}px;
      }
      .graphWrapper h1{
        font-size: {{=m.titleFontSize}};
        color: {{=m.titleFontColor}};
        font-family: {{=m.titleFontFamily}};
      }
      .colorBox {
        width: {{=m.legendFontSize}};
        height: {{=m.legendFontSize}};
      }
      .legend{
        font-family: {{=m.legendFontFamily}};
        font-size: {{=m.legendFontSize}};
        color: {{=m.legendFontColor}};
      }
      .legendBox{
        background-color: {{=m.legendBackgroundColor}};
        border: 1px solid {{=m.legendBorderColor}};
        border-radius: {{=0.5*parseInt(m.backgroundBorderRadius)}}px;
      }

      .c3-line{
        stroke-width: {{=m.plotlineThickness}} !important;
      }

      tspan{
        font-size: {{=m.axesFontSize}};
        fill: {{=m.axesFontColor}};
        font-family: {{=m.axesFontFamily}};
      }
      .c3-axis-x-label, .c3-axis-y-label{
        font-size: {{=1.5*parseInt(m.axesFontSize)}}px !important;
        fill: {{=m.axesFontColor}} !important;
        font-family: {{=m.axesFontFamily}} !important;
      }
      .c3-axis-y-label{
        /*transform: translateX(-{{=parseInt(m.axesFontSize)/4}}px) !important;*/
      }
      .powrMark {
        background: {{=m.backgroundColor}};
        color:{{=m.titleFontColor}}!important;
      }
      .c3-axis .tick text{
        transform: translateY({{=parseInt(m.axesFontSize)/4}}px) !important;
      }
      .c3-axis line, .c3-axis path{
        stroke: {{=m.axesFontColor}} !important;
      }
      .c3-legend-item text{
        stroke: {{=m.legendFontColor}} !important;
        font-family: {{=m.legendFontFamily}} !important;
      }

      {{ if(m.graphType == 'horizontalBar'){ }}
        .graph svg{
          /*left: 15%;*/
          /*width: 70%;*/
        }
      {{ } else { }}
       .c3-axis-x-label, .c3-axis-y-label{
          stroke:none;
       }
       {{ } }}

      {{ if(m.graphType == 'pie'){ }}
        .rightLegend .legendWrapper{
          /*width: {{= parseInt(m.pluginWidth) - 0.5*0.85*parseInt(m.pluginWidth) }}px !important;*/
          /*height: {{= 0.85*parseInt(m.pluginWidth) }}px; *//*Height is specified for pie chart*/
        }
        .rightLegend .graph, .rightLegend .legendWrapper{
          height: {{= 0.85*parseInt(m.pluginWidth) }}px; /*Height is specified for pie chart*/
        }
        .bottomLegend .graph,{
          height: {{= 1*parseInt(m.pluginWidth) }}px;
        }
      {{ }else{ }}
        .rightLegend .legendWrapper{
          height: {{=m.pluginHeight}};
        }
      {{ } }}


    </style>
</script>
